          <Form.Label>GIR</Form.Label>
          <Form.Range />
        </div>
        <div className="selectionFour">
          <Form.Label>Birdies</Form.Label>
          <Form.Range />
        </div> */}

        <Form>
          <Form.Group>
            <Form.Label>Birdies</Form.Label>
            <RangeSlider
              value={value}
              onChange={(e) => setValue(e.target.value)}
            />

<Form.Label>Birdies</Form.Label>
            <RangeSlider
              value={value}
              onChange={(e) => setValue(e.target.value)}
            />
          </Form.Group>
        </Form>
      </div>
    </div>
  );
}

export default AlgorithmForm;
